def count_numbers_with_nine_divisors(N):
    c = 1
    limit = int(N ** 0.5)
    prime = [i for i in range(limit + 1)]
    i = 2
    while i * i <= limit:
        if prime[i] == i:
            for j in range(i * i, limit + 1, i):
                if prime[j] == j:
                    prime[j] = i
        i += 1
    for i in range(2, limit + 1):
        p = prime[i]
        q = prime[i // prime[i]]
        if p * q == i and q != 1 and (p != q):
            c += 1
        elif prime[i] == i:
            if i ** 8 <= N:
                c += 1
    return c

